import api from '../api/api';

export const getToken = async () =>
  api.autentication
    .token.getToken()
    .then((response) => {
        console.log("la resp" , response.body.text())
        return response.text()
    })
    .then((response) => ({ response: response.data }))
    .catch((error) => ({ error }));



export default getToken;
